import React from "react";
import { ProdFormContainer, ProdutoContainer } from "./Produto.Style";

export const Produto = () => {
  return (
    <ProdutoContainer>
      <ProdFormContainer>
        <div className="title">Cadastro de Produto</div>
        <div className="form">
          <form>
            <input></input>
            <hr></hr>
          </form>
        </div>
      </ProdFormContainer>
    </ProdutoContainer>
  );
};
